class Agency:
    def __init__(self, name):
        self.name = name
        self.submissions = []

    def add_submission(self, submission):
        self.submissions.append(submission)


class Submission:
    def __init__(self, file_name, file_type):
        self.file_name = file_name
        self.file_type = file_type
        self.status = "pending"

    def update_status(self, status):
        self.status = status


class SystemAdministrator:
    def __init__(self):
        self.agencies = []

    def add_agency(self, agency):
        self.agencies.append(agency)

    def add_submission(self, submission, agency):
        for a in self.agencies:
            if a.name == agency:
                a.add_submission(submission)
                return

    def validate_submission(self, submission):
        valid_types = ["csv", "json", "xml"]
        if submission.file_type.lower() in valid_types:
            return True
        return False

    def process_submission(self, submission):
        if self.validate_submission(submission):
            submission.update_status("processed")
            return True
        return False


class DataManager:
    def __init__(self):
        self.fpds_data = []

    def load_fpds_data(self, data):
        self.fpds_data.extend(data)

    def retrieve_fpds_data(self):
        return self.fpds_data


class USASpendingAdministrator:
    def __init__(self, system_administrator, data_manager):
        self.system_administrator = system_administrator
        self.data_manager = data_manager

    def get_all_fabs_submissions(self):
        submissions = []
        for agency in self.system_administrator.agencies:
            submissions.extend(agency.submissions)
        return submissions

    def get_all_fpds_data(self):
        return self.data_manager.retrieve_fpds_data()

    def process_fabs_submission(self, submission):
        return self.system_administrator.process_submission(submission)


class Broker:
    def __init__(self, system_administrator, data_manager):
        self.system_administrator = system_administrator
        self.data_manager = data_manager

    def upload_and_validate_file(self, file_name, file_type):
        submission = Submission(file_name, file_type)
        if self.system_administrator.validate_submission(submission):
            return True
        return False

    def retrieve_all_fabs_submissions(self):
        return self.system_administrator.get_all_fabs_submissions()

    def retrieve_all_fpds_data(self):
        return self.data_manager.retrieve_fpds_data()


# Example usage
if __name__ == "__main__":
    system_administrator = SystemAdministrator()
    agency = Agency("Test Agency")
    system_administrator.add_agency(agency)
    submission = Submission("test_file.csv", "csv")
    system_administrator.add_submission(submission, "Test Agency")
    print("Submission is valid: ", system_administrator.validate_submission(submission))
    print("Submission status before processing: ", submission.status)
    system_administrator.process_submission(submission)
    print("Submission status after processing: ", submission.status)

    data_manager = DataManager()
    data_manager.load_fpds_data([1, 2, 3])
    print("FPDS data: ", data_manager.retrieve_fpds_data())

    usaspending_administrator = USASpendingAdministrator(system_administrator, data_manager)
    print("All FABS submissions: ", usaspending_administrator.get_all_fabs_submissions())
    print("All FPDS data: ", usaspending_administrator.get_all_fpds_data())
    print("Submission processed: ", usaspending_administrator.process_fabs_submission(submission))

    broker = Broker(system_administrator, data_manager)
    print("File is valid: ", broker.upload_and_validate_file("test_file.csv", "csv"))
    print("All FABS submissions: ", broker.retrieve_all_fabs_submissions())
    print("All FPDS data: ", broker.retrieve_all_fpds_data())
